import * as React from 'react';
import Box from '@mui/material/Box';
import Typography from '@mui/material/Typography';
import { Link as ReactRouterLink } from 'react-router-dom';
import AppBar from '../modules/components/AppBar';
import Toolbar from '../modules/components/Toolbar';

const rightLink = {
  fontSize: 16,
  color: 'common.white',
  ml: 3,
};

function Navbar() {
  return (
    <div>
      <AppBar position="fixed">
        <Toolbar sx={{ justifyContent: 'space-between' }}>
            <Typography component={ReactRouterLink} to="/" 
                sx={{color:"white", textDecoration: 'none', fontWeight: '900', fontSize:24, fontFamily:'Roboto Condensed'}}
            >
                BRANDNAME
            </Typography>
          <Box sx={{ flex: 1, display: 'flex', justifyContent: 'flex-end' }}>
            <Stack direction="row" spacing={2}>
                <Typography component={ReactRouterLink} to="/" 
                    sx={{color:"white", textDecoration: 'none', fontWeight: '900', fontSize:18, fontFamily:'Roboto Condensed'}}
                >
                    ABOUT
                </Typography>
                <Typography component={ReactRouterLink} to="/" 
                    sx={{color:"white", textDecoration: 'none', fontWeight: '900', fontSize:18, fontFamily:'Roboto Condensed'}}
                >
                    CONTACT
                </Typography>
            </Stack>
            </Box>
        </Toolbar>
      </AppBar>
      <Toolbar />
    </div>
  );
}

export default Navbar;
